/*
        HELPER FUNCTIONS
*/

function sleep(ms) {
    return new Promise(resolve => setTimeout(resolve, ms));
  }

/*
        IO UTILITIES
*/
function getTextFromURL(file) {
    var rawFile = new XMLHttpRequest();
    rawFile.open("GET", file, false);
    rawFile.onreadystatechange = function () {
        if(rawFile.readyState === 4) {
            if(rawFile.status === 200 || rawFile.status == 0) {
                var allText = rawFile.responseText;
                return allText;
            }
        }
    }
    rawFile.send(null);
}

function sendDataToURL(data) {
    url = "https://islands.ibpp.me"

    id = id + 1
    payload = {
        "id": id,
        "data": data
    }

    var xhr = new XMLHttpRequest();
    xhr.open("POST", url);
    xhr.setRequestHeader("Accept", "application/json");
    xhr.setRequestHeader("Content-Type", "application/json");
    xhr.onreadystatechange = function () {
       if (xhr.readyState === 4) {
          console.log(xhr.status);
          console.log(xhr.responseText);
       }
    };

    xhr.send(JSON.stringify(payload));
}

/*
        MAIN PROCEDURES
*/
function processIslander() {
    var response_text = xhr.responseText;
    sendDataToURL(response_text);
}

async function main() {
    // For each islander, process islander
    for(var l = 0; l < islanders.length; l++) {
        console.log("Processing islander " + l + "/" + islanders.length + ": " + islanders[l]);
        var url = "https://islands.smp.uq.edu.au/islander.php?id=" + islanders[l];

        xhr = new XMLHttpRequest();
        xhr.onload = processIslander;
        xhr.open("GET", url, false);
        xhr.send(null);
    }

    console.log("Done!")
}

main();

/*
        ISLANDER COLLECTING
*/
var islander_id_regex = /id=(.*?)"/gm;

async function go_through_houses_in_village() {
    var islanders = [];
    // For each house, request house data and
    //   process it.
    for(var i = 0; i < 1436; i++) {
        console.log("Processing house: " + i);
        xhr = new XMLHttpRequest();
        var url = "house.php?v=6&h=" + i;
        xhr.onload = processHouseData;
        xhr.open("GET", url, true);
        xhr.send(null);
        await sleep(300);
    }

    console.log("FOUND NUMBER OF ISLANDERS: " + islanders.length)
}

function processHouseData() {
    var response_text = xhr.responseText;
    var match;
    var i = j = 0;

    // For each line in the response, take each line containing
    //   an islander and match its ID. Then, process each islander.
    while((j = response_text.indexOf("\n", i)) !== -1) {
        var line = response_text.substring(i, j);
        if(line.includes("islander")) {
            while((match = islander_id_regex.exec(line)) !== null) {

                // Precaution to prevent infinite loops
                if(match.index === islander_id_regex.lastIndex) {
                    islander_id_regex.lastIndex++;
                }

                match.forEach((match, groupIndex) => {
                    if(groupIndex === 1) {
                        // match is islander's ID
                        islanders.push(match);
                    }
                });
            }
        }
        i = j + 1;
    }
}
